import './App.css';
import Navbar from './Navbar/Navbar';
import Login from './Login/Login';

//Dashboards
import Dashboard from './Dashboard/Dashboard';
import Memberdashboard from './Dashboard/Memberdashboard';
import Admindashboard from './Dashboard/Admindasboard';

//Members
import Register from './Register/Register';
// import Members from './Members/Members';

//Users
import User from './User/User';
import Indmember from './Indmember/Indmember';
import Card from './Card/Card';

//Listings
import M from './M/M';
// import Userlist from './User/Userlist';
// import Girlslist from './Seperatelisting/Boyslist/Boyslist';
// import Boyslist from './Seperatelisting/Girlslist/Girlslist';
// import UserlistSearch from './User/Userlistsearch';

//Posts
import Post from './Post/Post';
import Createpost from './Post/Createpost';

//Hooks
import useFetch from '../custom-hooks/useFetch'
import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom'

function App() {
  const {memberdata:members, isLoading, errMessage, deleteMemberdata} = useFetch("http://localhost:5000/members");
  const {userdata:users, deleteUserdata} = useFetch("http://localhost:5000/userlist");
  const {postdata:posts, deletePostdata} = useFetch("http://localhost:5000/posts");
  // const {girlsdata:girlsdata} = useFetch("http://localhost:5000/girlslist");
  // const {boysdata:boydata} = useFetch("http://localhost:5000/boyslist");
  return (
      <Router>
        <div className="App">
        <Navbar/>
          <main>
            <Switch>
              <Route exact  path="/">
                <Dashboard />
              </Route>

              <Route exact  path="/admindashboard">
                <Admindashboard />
              </Route>
              <Route exact  path="/memberdashboard">
                <Memberdashboard />
              </Route>

              {/* <Route path="/members">
                {errMessage && <div>{errMessage}</div>}
                {isLoading && <div>Loading...</div>}
                {members && <Members members={members} deletemember={deletemember}/>}
              </Route> */}

              <Route path="/members">
                {errMessage && <div>{errMessage}</div>}
                {isLoading && <div>Loading...</div>}
                {members && <Newlisting members={members} deleteMemberdata={deleteMemberdata}/>}
              </Route>

              <Route path="/posts">
                {errMessage && <div>{errMessage}</div>}
                {isLoading && <div>Loading...</div>}
                {posts && <Post posts={posts} deletePostdata={deletePostdata}/>}
              </Route>

              {/* <Route path="/members">
                {errMessage && <div>{errMessage}</div>}
                {isLoading && <div>Loading...</div>}
                {members && <Members members={members} deleteMemberdata={deleteMemberdata}/>}
              </Route> */}

              <Route exact path="/createpost">
                <Createpost />
              </Route>

              <Route exact path="/register">
                <Register />
              </Route>

              <Route exact path="/login">
                <Login />
              </Route>

              <Route exact path="/user">
                <User />
              </Route>

              <Route exact path="/userlist">
                {users && <Userlist users={users}/>}
              </Route>

              <Route exact path="/girlslist">
                {users && <Girlslist users={users}/>}
              </Route>

              <Route exact path="/boyslist">
                {users && <Boyslist users={users}/>}
              </Route>

              {/* <Route exact path="/userlistsearch">
                {users && <UserlistSearch users={users} deleteUserdata={deleteUserdata}/>}
              </Route> */}

              <Route exact path="/indmember">
                {users && <Indmember users={users} deleteUserdata={deleteUserdata}/>}
              </Route>

              <Route exact path="/card">
                {users && <Card users={users}/>}
              </Route>

              <Route path="*">
                <div>Page not found. Go back to <Link to="/">Dashboard</Link></div>
              </Route>
            </Switch>
          </main>
        </div>
      </Router>
  );
}

export default App;
